import React from "react";
import { Link,NavLink } from "react-router-dom";
import logo from './photo.jpg'


function Navbar() {
  return (
    <>
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <div className="container-fluid">
          <Link className="navbar-brand heading mt-auto" to="/">
            <img
              src={logo}
              alt="img"
              width="30"
              height="23"
              class="d-inline-block align-text-top"
            />
            <span className="headinginside">BlockEase</span>
          </Link>

          <div className="d-flex" id="navbarNav">
            <div className="navlinks">
              <ul className="navbar-nav mr-auto mb-2 m-lg-0">
                <Navcomp name="Home" link="" />
                <Navcomp name="Service" link="service" />
                <Navcomp name="About" link="about" />
                <Navcomp name="Contactus" link="contactus" />
              </ul>
            </div>
          </div>
        </div>
      </nav>
    </>
  );
}

const Navcomp = (props) => {
  return (
    <>
      <li className="nav-item items">
        <NavLink className="nav-link active" to={"/" + props.link}>
          <h4>{props.name}</h4>
        </NavLink>
      </li>
    </>
  );
};

export default Navbar;
